import React from 'react';
import { Box, Typography, Card, CardContent, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Business({ handleLogout }) {
    const navigate = useNavigate();

    const handleLogoutClick = () => {
        handleLogout();
        navigate('/login');
    };

    return (
        <Box sx={{ p: 3 }}>
            <Card>
                <CardContent>
                    <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                        <Typography variant="h5">Business Dashboard</Typography>
                        <Button 
                            variant="outlined" 
                            color="secondary" 
                            onClick={handleLogoutClick}
                        >
                            Logout
                        </Button>
                    </Box>
                    <Typography variant="body1" sx={{ mb: 2 }}>
                        Welcome to your business dashboard. Your configuration has been validated successfully.
                    </Typography>
                    {/* Add more business-specific content here */}
                </CardContent>
            </Card>
        </Box>
    );
}

export default Business;
